# @param {String} s
# @param {String} p
# @return {Integer[]}


#Input: s = "abab", p = "ab"

def build_dictionary(str)
  dictionary = {}
  str.each_char do |char|
    dictionary[char] ||= 0
    dictionary[char] += 1
  end
  dictionary
end

def find_anagrams(str, search_str)
  search_dictionary = build_dictionary(search_str)
  search_str_length = search_str.length
  window_dictionary = {}
  anagram_occurences = []

  (0..str.length - 1).each do |i|
    char = str[i]

    window_dictionary[char] ||= 0
    window_dictionary[char] += 1

    if i > search_str_length - 1
      
      deleted_char = str[i - search_str_length]
      if window_dictionary[deleted_char] > 1
        window_dictionary[deleted_char] -= 1
      else
        window_dictionary.delete(deleted_char)
      end
    end

    anagram_occurences.push(i - search_str_length + 1) if window_dictionary.eql?(search_dictionary)
  end
  anagram_occurences
end

a ="aaaaaaaaaaaaaaaaaaaaaaaaaaaa
"
b = ""
p a.length
p b.length

require 'benchmark'
puts Benchmark.measure { find_anagrams(a, b) }

